mmer months.\n","\n","The casual riders would buy Cyclistic annual memberships if the company offers special conditions for weekends or summer time.\n","\n","Cyclistic can use digital media to influence casual riders to become members by creating gamification for members.\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":2792933,"sourceId":4821469,"sourceType":"datasetVersion"}],"dockerImageVersionId":30352,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":548.316654,"end_time":"2025-07-09T19:41:22.713639","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-07-09T19:32:14.396985","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}